import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

const brands = [
  { name: 'Brand 1', logo: 'https://d1yjjnpx0p53s8.cloudfront.net/styles/logo-original-577x577/s3/032018/untitled-1_316.png?DLmYm90A9lyIN1lw3PPt2ICmZY2KgnS4&itok=HqkJOqxz' },
  { name: 'Brand 2', logo: 'https://d1yjjnpx0p53s8.cloudfront.net/styles/logo-original-577x577/s3/032018/untitled-1_316.png?DLmYm90A9lyIN1lw3PPt2ICmZY2KgnS4&itok=HqkJOqxz' },
  { name: 'Brand 3', logo: 'https://d1yjjnpx0p53s8.cloudfront.net/styles/logo-original-577x577/s3/032018/untitled-1_316.png?DLmYm90A9lyIN1lw3PPt2ICmZY2KgnS4&itok=HqkJOqxz' },

];

const BrandsSection = () => (
  <Container className="my-5">
    <Row>
      {brands.map((brand, index) => (
        <Col md={4} key={index}>
          <img src={brand.logo}  alt={brand.name} className="img-fluid" style={{  height: 130 }} />
        </Col>
      ))}
    </Row>
  </Container>
);

export default BrandsSection;
